  true,\n\t\"url\": null,\n\t\"notes\": \"The FOIA Tracking and Reporting System (FOIAXpress)
  is a COTS application designed to assist government organizations in performing,
  documenting, and reporting on the security and risk management activities required
  by all government organizations managing information systems. The tool is intended
  to streamline security risk management processes while ensuring adherence to the
  Federal Information Security Management Act (FISMA) and important Office of Management
  and Budget (OMB) and National Institute of Standards and Technology (NIST) guidelines.
